Cake - Short Skirt-Long Jacket [promo].VOB


HQ promo video. The music video for this song is composed entirely of vox pop 
footage of members of the public listening to the song on headphones. They are 
seen displaying a wide range of reactions to the unconventional style of the song, 
expressing enthusiasm, criticism or apathy. It's the &quot;Chuck&quot; tv show theme song.


